import { Route, Routes, Redirect, withRouter, BrowserRouter } from 'react-router-dom';
import { Layout } from './Layout/Layout';
import { Login } from './pages/Login';
import { SignUp } from './pages/SignUp';


function App() {

  const route = (
    <Routes>
      <Route path="/login" element={ <Login/> }/>
      <Route path="/signup" element={ <SignUp/> } />
    </Routes>
  )



  return (

      <div className="App">
        <Layout>
          {route}
        </Layout>
      </div>

  );
}

export default App;
